import FriendCard from "./FriendCard";
import classes from "./AllFriendsInfo.module.css";

const AllFriendsInfo = () => {
  const [allFriends, setAllFriends] = useState([]);
  const fetchAllFriends = async () => {
    try {
      const response = await fetch("http://localhost:8080/getallusers");
      if (!response.ok) {
        throw new Error("Something went wrong");
      }
      const body = await response.json();
      console.log(body);
      setAllFriends(body);
    } catch (error) {
      console.log(error.message);
    }
  };
  fetchAllFriends();
  const allFriendsCard = allFriends.map((friend) => <FriendCard ke />);
  return (
    <div className={classes.friendsinfo}>
      <h1>All friends</h1>
      <FriendCard />
    </div>
  );
};

